import React from "react";

import { BrowserRouter as Router, Route } from "react-router-dom";
import {
  Card,
  CardBody,
  CharacterName,
  CardFooter,
  CardDetailsLink,
} from "./styles";

const PeopleCard = ({
  person: { name, url, mass, height, gender, homeworld },
}) => {
  return;

  function getId(url) {
    return url.split("/")[url.split("/").length - 2];
  }
  <div>
    <Card>
      <CardBody>
        <CharacterName>{name}</CharacterName>
      </CardBody>
      <CardFooter>
        <Router>
          <CardDetailsLink className="link" to={`/details/${url}`}>
            Details
          </CardDetailsLink>
        </Router>
      </CardFooter>
    </Card>
  </div>;
};

export default PeopleCard;
